import React, {useContext} from 'react';
import { Route, Switch } from 'react-router-dom';

import AuthContext from '../contexts/Auth';

import AppPaciente from '../routes/App.Paciente.Routes';
import AppSecretaria from '../routes/App.Secretaria.Routes';
import AppMedico from '../routes/App.Medico.Routes';
import Appauth from '../routes/App.Auth.Routes';

export default function RouteWrapper() {
    const {signed, tipo_usuario} = useContext(AuthContext);
    if(signed && tipo_usuario == 'paciente'){
        <AppPaciente />
    }
    else if(signed && tipo_usuario == 'secretaria'){
        <AppSecretaria />
    } else if(signed && tipo_usuario == 'medico'){
        <AppMedico />
    }else {
        <Appauth />
    }
}
